INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (155, 100101, "獣人族", "ヒヨリ", "トゥインクルウィッシュ", "人助け、応援", 0, 44, 8, "A", 27, 16, "人助けが大好き！　前向き格闘娘", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "東山奈央", 2);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (158, 100201, "ヒューマン", "ユイ", "トゥインクルウィッシュ", "料理、人間観察", 0, 47, 4, "O", 5, 17, "戦闘のサポートが得意な、心優しい少女", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 2);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (163, 100301, "魔族", "レイ", "トゥインクルウィッシュ", "読書、乗馬、お茶", 0, 46, 1, "B", 12, 18, "クールで何事にも真っ直ぐな剣士", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 2);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (128, 100401, "ヒューマン", "ミソギ", "リトルリリカル", "いたずら、探検", 0, 27, 8, "O", 10, 9, "探検好きのイタズラっ子", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "諸星すみれ", 5);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (146, 100501, "獣人族", "マツリ", "王宮騎士団（NIGHTMARE）", "ヒーローごっこ", 0, 40, 11, "O", 25, 12, "ヒーローに憧れる騎士見習いの少女", "？？？", "下田麻美", 8);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (150, 100601, "魔族", "アカリ", "悪魔偽王国軍（ディアボロス）", "サックス", 0, 42, 11, "O", 22, 13, "甘え上手なみんなの人気者", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "浅倉杏美", 7);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (130, 100701, "魔族", "ミヤコ", "悪魔偽王国軍（ディアボロス）", "プリンを食べること", 0, 32, 1, "B", 23, 14, "プリン大好きゴースト娘", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "雨宮天", 7);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (150, 100801, "エルフ", "ユキ", "ヴァイスフリューゲル　ランドソル支部", "鏡で自分を見ること", 0, 40, 10, "AB", 10, 14, "ボクは誰よりも美しい", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "大空直美", 15);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (159, 100901, "魔族", "アンナ", "トワイライトキャラバン", "小説執筆", 0, 45, 7, "A", 5, 17, "前世を信じる中二病患者、「疾風の冥姫」", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "髙野麻美", 13);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (155, 101001, "獣人族", "マホ", "自警団（カォン）", "空想、ぬいぐるみ集め", 0, 42, 9, "O", 22, 16, "マホマホ王国のプリンセス", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "内田真礼", 10);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (156, 101101, "ヒューマン", "リノ", "ラビリンス", "お裁縫", 0, 44, 8, "A", 25, 15, "人懐っこくてマシンガントークな妹系少女", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "阿澄佳奈", 3);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (156, 101201, "エルフ", "ハツネ", "フォレスティエ", "妹と遊ぶこと、二度寝、昼寝、早寝", 0, 46, 12, "A", 24, 17, "みんなのために超能力を使う眠り姫", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "大橋彩香", 6);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (166, 101301, "魔族", "ナナカ", "トワイライトキャラバン", "読書、魔法", 0, 55, 8, "O", 21, 18, "オタク全開な魔法少女", "", "佳村はるか", 13);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (152, 101401, "獣人族", "カスミ", "自警団（カォン）", "読書、推理", 0, 41, 11, "AB", 3, 15, "頭脳明晰な美少女名探偵", "test", "水瀬いのり", 10);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (165, 101501, "エルフ", "ミサト", "フォレスティエ", "絵本作り", 0, 54, 9, "O", 5, 21, "母性溢れる優しいみんなの「ミサト先生」", "test", "國府田マリ子", 6);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (167, 101601, "魔族", "スズナ", "ルーセント学院", "ファッション", 0, 48, 4, "O", 10, 17, "天真爛漫で人気者のカリスマモデル", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "上坂すみれ", 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (158, 101701, "獣人族", "カオリ", "自警団（カォン）", "踊り、空手", 0, 53, 7, "A", 7, 17, "いつでも「なんくるないさ～」な天然娘", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "高森奈津美", 10);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (162, 101801, "魔族", "イオ", "ルーセント学院", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 0, 52, 8, "B", 14, 23, "多くの男性を魅了する無垢な女教師", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "伊藤静", 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (117, 102001, "獣人族", "ミミ", "リトルリリカル", "かわいいもの集め", 0, 21, 4, "O", 3, 10, "お歌もにんじんも、ウサギさんも大好き♪", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "日高里菜", 5);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (150, 102101, "ヒューマン", "クルミ", "サレンディア救護院", "観劇、おままごと", 0, 40, 6, "B", 9, 12, "泣き虫で臆病な守ってあげたい女の子", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 9);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (150, 102201, "魔族", "ヨリ", "悪魔偽王国軍（ディアボロス）", "ゲーム全般", 0, 40, 11, "O", 22, 13, "人見知りであまのじゃくな女の子", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "原紗友里", 7);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (148, 102301, "ヒューマン", "アヤネ", "サレンディア救護院", "屋内でできる遊び", 0, 38, 5, "B", 10, 14, "ぷうきちといつも一緒！", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 9);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (154, 102501, "ヒューマン", "スズメ", "サレンディア救護院", "ご奉仕", 0, 43, 12, "O", 12, 15, "お嬢さまのためにがんばるドジっ娘メイド", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "悠木碧", 9);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (144, 102601, "獣人族", "リン", "牧場（エリザベスパーク）", "あんパン", 0, 42, 1, "B", 1, 17, "遊びと睡眠が何より大事なぐうたら娘", "test", "小岩井ことり", 11);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (154, 102701, "魔族", "エリコ", "トワイライトキャラバン", "実験、裁縫、料理", 0, 43, 7, "B", 30, 16, "運命の相手に一途すぎる乙女", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 13);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (156, 102801, "エルフ", "サレン", "サレンディア救護院", "経営、お茶会", 0, 43, 10, "A", 4, 17, "救護院を経営する優しい庶民派お嬢様", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "堀江由衣", 9);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (157, 102901, "ヒューマン", "ノゾミ", "カルミナ", "舞台鑑賞、ダンス", 0, 40, 1, "B", 24, 17, "歌って踊れる大人気アイドル", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "日笠陽子", 4);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (163, 103001, "ヒューマン", "ニノン", "ヴァイスフリューゲル　ランドソル支部", "忍法開発", 0, 51, 8, "O", 31, 16, "トーゴクの神秘、オシエテクダサイ！", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "佐藤聡美", 15);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (157, 103101, "魔族", "シノブ", "悪魔偽王国軍（ディアボロス）", "占い", 0, 42, 12, "AB", 22, 18, "占いが得意な霊能少女", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 7);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (157, 103201, "ヒューマン", "アキノ", "メルクリウス財団", "慈善事業", 0, 45, 3, "AB", 12, 18, "一人前の商人を目指すパワフルお嬢様", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "松嵜麗", 12);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (142, 103301, "ヒューマン", "マヒル", "牧場（エリザベスパーク）", "漫才", 0, 35, 3, "B", 3, 20, "みんなを笑顔にするお笑い牧場主", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "新田恵海", 11);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (164, 103401, "エルフ", "ユカリ", "メルクリウス財団", "ウインドーショッピング", 0, 55, 3, "A", 16, 22, "純情でほっとけない大人の女性", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "今井麻美", 12);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (118, 103601, "エルフ", "キョウカ", "リトルリリカル", "お勉強", 0, 21, 2, "A", 2, 8, "礼儀正しくしっかり者のちびっ子優等生", "test", "小倉唯", 5);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (149, 103701, "ヒューマン", "トモ", "王宮騎士団（NIGHTMARE）", "剣術、年長者をからかう", 0, 43, 8, "A", 11, 13, "義理堅くてからかい好きな剣術少女", "test", "茅原実里", 8);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (153, 103801, "獣人族", "シオリ", "牧場（エリザベスパーク）", "読書、お散歩", 0, 40, 11, "A", 3, 14, "読書が趣味の病弱少女", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "小清水亜美", 11);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (158, 104001, "エルフ", "アオイ", "フォレスティエ", "友達作りのイメトレ", 0, 44, 6, "AB", 6, 13, "「友達」に憧れる、エルフの森の女の子", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "花澤香菜", 6);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (163, 104201, "ヒューマン", "チカ", "カルミナ", "各種楽器", 0, 46, 6, "O", 3, 17, "人々を守るために歌う、唱喚士の少女", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 4);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (168, 104301, "獣人族", "マコト", "自警団（カォン）", "お菓子作り", 0, 54, 8, "O", 9, 17, "男勝りで情に厚いワイルド娘", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "小松未可子", 10);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (172, 104401, "魔族", "イリヤ", "悪魔偽王国軍（ディアボロス）", "世界征服", 0, 50, 5, "A", 5, "??", "かつては夜を支配した最強の吸血鬼", "test", "丹下桜", 7);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (157, 104501, "ヒューマン", "クウカ", "ヴァイスフリューゲル　ランドソル支部", "小説を読むこと", 0, 49, 11, "AB", 19, 18, "妄想大好き！　ほんとは照れ屋な女の子", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "長妻樹里", 15);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (158, 104601, "獣人族", "タマキ", "メルクリウス財団", "猫とたわむれること", 0, 48, 3, "AB", 1, 19, "弱きを助け強きをくじく猫娘", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "沼倉愛美", 12);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (171, 104701, "ヒューマン", "ジュン", "王宮騎士団（NIGHTMARE）", "格闘技、湯浴み", 0, 50, 10, "A", 25, 25, "素顔を見せない冷静沈着な女性騎士", "？？？", "川澄綾子", 8);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (163, 104801, "ヒューマン", "ミフユ", "メルクリウス財団", "傭兵などのアルバイト", 0, 49, 11, "O", 11, 20, "仕事も私事も効率優先な傭兵少女", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 12);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (168, 104901, "ヒューマン", "シズル", "ラビリンス", "家事全般", 0, 54, 10, "O", 24, 18, "お姉ちゃんがお世話してあげるからねっ！", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "生天目仁美", 3);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (120, 105001, "魔族", "ミサキ", "ルーセント学院", "ファッション誌鑑賞、コスメ集め", 0, 22, 1, "A", 3, 11, "ちょっとおませな恋に恋する女の子", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "久野美咲", 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (166, 105101, "ヒューマン", "ミツキ", "トワイライトキャラバン", "研究、実験", 0, 53, 3, "A", 7, 27, "実験が趣味の危険な科学者", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "三石琴乃", 13);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (150, 105201, "獣人族", "リマ", "牧場（エリザベスパーク）", "毛繕い、お喋り", 0, 100, 3, "A", 14, 17, "乙女チックなもふもふアニマル", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "徳井青空", 11);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (140, 105301, "ヒューマン", "モニカ", "ヴァイスフリューゲル　ランドソル支部", "お菓子屋通い", 0, 33, 7, "A", 28, 17, "見た目も中身もお子ちゃまな異国の軍人", "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "辻あゆみ", 15);
