INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (156, 105701, "ヒューマン", "ジータ", "？？？", "冒険、おしゃべり", 0, 45, 3, "O", 10, 17, "空への冒険を夢見る騎空士の少女", "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "金元寿子", "");
