INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (163, 108001, "ヒューマン", "ミフユ（サマー）", "メルクリウス財団", "傭兵などのアルバイト", 0, 49, 11, "O", 11, 20, "仕事も私事も効率優先な傭兵少女", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 12);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (157, 108101, "魔族", "シノブ（ハロウィン）", "悪魔偽王国軍（ディアボロス）", "占い", 0, 42, 12, "AB", 22, 18, "占いが得意な霊能少女", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 7);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (130, 108201, "魔族", "ミヤコ（ハロウィン）", "悪魔偽王国軍（ディアボロス）", "プリンを食べること", 0, 32, 1, "B", 23, 14, "プリン大好きゴースト娘", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "雨宮天", 7);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (120, 108301, "魔族", "ミサキ（ハロウィン）", "ルーセント学院", "ファッション誌鑑賞、コスメ集め", 0, 22, 1, "A", 3, 11, "ちょっとおませな恋に恋する女の子", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "久野美咲", 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (163, 108401, "ヒューマン", "チカ（クリスマス）", "カルミナ", "各種楽器", 0, 46, 6, "O", 3, 17, "人々を守るために歌う、唱喚士の少女", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 4);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (150, 108501, "ヒューマン", "クルミ（クリスマス）", "サレンディア救護院", "観劇、おままごと", 0, 40, 6, "B", 9, 12, "泣き虫で臆病な守ってあげたい女の子", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 9);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (148, 108601, "ヒューマン", "アヤネ（クリスマス）", "サレンディア救護院", "屋内でできる遊び", 0, 38, 5, "B", 10, 14, "ぷうきちといつも一緒！", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 9);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (155, 108701, "獣人族", "ヒヨリ（ニューイヤー）", "トゥインクルウィッシュ", "人助け、応援", 0, 44, 8, "A", 27, 16, "人助けが大好き！　前向き格闘娘", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "東山奈央", 2);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (158, 108801, "ヒューマン", "ユイ（ニューイヤー）", "トゥインクルウィッシュ", "料理、人間観察", 0, 47, 4, "O", 5, 17, "戦闘のサポートが得意な、心優しい少女", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 2);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (163, 108901, "魔族", "レイ（ニューイヤー）", "トゥインクルウィッシュ", "読書、乗馬、お茶", 0, 46, 1, "B", 12, 18, "クールで何事にも真っ直ぐな剣士", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 2);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (154, 109001, "魔族", "エリコ（バレンタイン）", "トワイライトキャラバン", "実験、裁縫、料理", 0, 43, 7, "B", 30, 16, "運命の相手に一途すぎる乙女", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 13);
