INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (156, 109201, "ヒューマン", "アン", "？？？", "読書", 0, 55, 12, "AB", 1, 17, "英霊と契約を結んだマナリアの天才王女", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "日笠陽子", "");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (144, 109301, "ヒューマン", "ルゥ", "？？？", "食べること、眠ること", 0, 45, 2, "O", 4, 16, "マナリア魔法学院の新入生", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "こやまきみこ", "");
