INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (157, 109501, "ヒューマン", "クウカ（オーエド）", "ヴァイスフリューゲル　ランドソル支部", "小説を読むこと", 0, 49, 11, "AB", 19, 18, "妄想大好き！　ほんとは照れ屋な女の子", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "長妻樹里", 15);
